import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import { Container, Row, Table } from 'react-bootstrap';

class Order extends Component {

  constructor (props) {
    super (props);

    this.order = props.order;
  }

  render() {
    return (
      <div>
        <Container>
          <Row>
            <Table responsive>
              <thead>
                <tr>
                  <th>Order Number</th>
                  <th>Status</th>
                  <th>Created Time</th>
                  <th>Total Price</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  {/* <td>{this.order.id}</td>
                  <td>{this.order.status}</td>
                  <td>{this.order.createdAt}</td>
                  <td>price here</td> */}
                   <td>id</td>
                  <td>status</td>
                  <td>createdAt</td>
                  <td>price here</td>
                </tr>
              </tbody>
            </Table>
          </Row>
        </Container>
      </div>
    );
  }
}

export default withRouter(Order);
